How to add ObjectId argument to a mongodb lookup<p>I am doing a lookup where the local field is an ObjectId and the foreign field is an array of ObjectId's. Performing the lookup gives me the error:</p>

<pre><code>arguments to $lookup must be strings
</code></pre>

<p>I have done similar lookups where the foreign field is not an array (but is an ObjectId) so the error seems to be ambiguous. my database consists two collections: Song and Playlist. A Song can belong to many playlists. I am trying to write an aggregation that returns a matching song that contains an array of playlists the song belongs to:</p>

<p><strong>Songs:</strong></p>

<pre><code>[
  {
    songName: "In Da Club",
    _id: ObjectId(1)
  },
  {
    songName: "Happy Birthday",
    _id: ObjectId(2)
  },
  {
    songName: "Ode to Joy",
    _id: ObjectId(3)
  }
]

</code></pre>

<p><strong>Playlists:</strong></p>

<pre><code>
[
  {
    _id: ObjectId(4)
    playlistName: "PlaylistOne,
    songs: [ObjectId(1), ObjectId(3)]
  },
  {
    _id: ObjectId(5)
    playlistName: "PlaylistTwo,
    songs: [ObjectId(1)]
  }
]

</code></pre>

<p><strong>Desired outcome:</strong></p>

<pre><code>
{
  songName: "In Da Club",
  _id: ObjectId(1),
  playlists: [
    {
      _id: ObjectId(4),
      playlistName: "PlaylistOne,
    },
    {
      _id: ObjectId(5),
      playlistName: "PlaylistTwo"
    }
  ]
}



</code></pre>

<p><strong>The query I tried:</strong></p>

<pre><code>db.songs.aggregate([
  {
    $match: {
      songName: "In Da Club"
    }
  },
  {
    $lookup: {
      from: 'playlists',
      let: { songId: '$_id'},
      pipeline: [
        {
          $match: {
            $expr: {
              {
                $in: ["$$songId", "$songs"]
              }
            }
          }
        }
      ],
      as: 'playlists'
    }
  }
])
</code></pre>

<p>It seems to be a relatively simple query and I'm not sure how I can get around the "arguments passed into lookup must be strings" error since my lookup is based on ObjectId's. Any help would be greatly appreciated! TIA!</p>

