How do I fix Error: No default engine was specified and no extension was provided. In my Express App?<p>I keep getting the following error when I run <code>PUT</code> request to update a document in my mongodb database using mongoose. </p>

<pre><code>PUT /books/5ebe23e548b95a15c006f9f7 500 8.598 ms - 5
Error: No default engine was specified and no extension was provided.
</code></pre>

<p>Here is how I am writing my api endpoints. All the other methods work <code>GET</code>, "POST", and "DELETE". The only one that is not working is <code>PUT</code>. Here is my 'PUT' endpoint: <code>http://localhost:5006/books/5ebe23e548b95a15c006f9f7</code> and here is the payload</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>{
    "title": "This is the Third book title",
    "description": "Third book description",
    "image": "",
    "price": 33
}</code></pre>
</div>
</div>
</p>

<p>And here is the who file.</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>const createError = require("http-errors")
const express = require("express")
const path = require("path")
const cookieParser = require("cookie-parser")
const logger = require("morgan")
const mongoose = require("mongoose")
const Books = require("./models/books")

const app = express()

app.use(logger("dev"))
app.use(express.json())
app.use(express.urlencoded({
  extended: false
}))
app.use(cookieParser())
app.use(express.static(path.join(__dirname, "public")))

mongoose
  .connect("mongodb://localhost:27017/bookshop", {
    useNewUrlParser: true,
    useUnifiedTopology: true,
    useCreateIndex: true,
    useFindAndModify: false,
  })
  .then(() =&gt; console.log("DB connected"))

// API's
app.post("/books", (req, res) =&gt; {
  const book = req.body

  Books.create(book, (err, books) =&gt; {
    if (err) {
      throw err
    }
    res.json(books)
  })
})

app.get("/books", (req, res) =&gt; {
  Books.find((err, books) =&gt; {
    if (err) {
      throw err
    }
    res.json(books)
  })
})

app.delete("/books/:_id", (req, res) =&gt; {
  const query = {
    _id: req.params._id
  }

  Books.remove(query, (err, books) =&gt; {
    if (err) {
      throw err
    }
    res.json(books)
  })
})

app.put("/books/:_id", (res, req) =&gt; {
  const book = req.body
  const query = {
    _id: req.params._id
  }
  // if the field doesn't exist $set will set a new field
  const update = {
    "$set": {
      title: book.title,
      description: book.description,
      image: book.image,
      price: book.price,
    },
  }
  // when true return the updated document
  const options = {
    new: true
  }

  Books.findByIdAndUpdate(query, update, options, (err, books) =&gt; {
    if (err) {
      throw err
    }
    res.json(books)
  })
})
// END API's

app.get("*", (req, res) =&gt; {
  res.sendFile(path.resolve(__dirname, "public", "index.html"))
})

// catch 404 and forward to error handler
app.use(function(req, res, next) {
  next(createError(404))
})

// error handler
app.use(function(err, req, res, next) {
  // set locals, only providing error in development
  res.locals.message = err.message
  res.locals.error = req.app.get("env") === "development" ? err : {}

  // render the error page
  res.status(err.status || 500)
  res.render("error")
})

module.exports = app</code></pre>
</div>
</div>
</p>

<p>What am I missing?</p>

