Schema relations: Argument passed in must be a single String of 12 bytes or a string of 24 hex characters<p>So I'm trying to make some realtions with mongoose. But when it comes to saving one schema to an other I get this error:</p>

<p><code>Argument passed in must be a single String of 12 bytes or a string of 24 hex characters</code></p>

<p>Here are some similar Schemas:</p>

<pre><code>mongoose = require('mongoose')
const Schema = mongoose.Schema

const userSchema = new Schema({
    _id: String,
    role: {
        type: String,
        default: 'Player'
    },
    tags: {
        type: [Schema.Types.ObjectId],
        ref: 'Tag'
    }
})

module.exports = mongoose.model('User', userSchema)
</code></pre>

<pre><code>mongoose = require('mongoose')
const Schema = mongoose.Schema

const tagSchema = new Schema({
    _id: {
        type: String,
        require: true
    },
    description: {
        type: String,
        require: true
    },
    color: {
        type: String,
        default: '#2476d1'
    }
})

module.exports = mongoose.model('Tag', tagSchema)
</code></pre>

<p>And how I'm trying to link</p>

<pre><code>try {
    const tag = await Tag.findOne({_id: 'Noob'})

    user.tags.push(tag.id)
    await user.save()
} catch (err) {
    console.error(`ERROR: ${user._id} at Noob check`)
    console.error(err)
}
</code></pre>

<p>According to other posts I've also tried pushing the <code>_id</code> like that:</p>

<pre><code>user.tags.push(mongoose.ObjectID(tag._id))
// and
user.tags.push(mongoose.ObjectID.createFromHexString('4e6f6f62')) // just 'Noob' in hex
</code></pre>

<p>And I still get that error. How can I create a reference with a custom <code>_id</code>?</p>

