MongoDB C# Driver Update Document with Aggregation Pipeline<p>As described <a href="https://docs.mongodb.com/master/reference/method/db.collection.update/index.html#update-with-aggregation-pipeline" rel="noreferrer">here</a> from <strong>MongoDB 4.2</strong> on it is possible to <strong>update documents with an aggregation pipeline</strong>. </p>

<p>It means that now it is possible to express "conditional updates based on current field values or <strong>updating one field using the value of another field(s)</strong>".</p>

<p>For instance:</p>

<pre><code>db.members.update(
   { },
   [
      { $set: { status: "Modified", comments: [ "$misc1", "$misc2" ], lastUpdate: "$$NOW" } },
      { $unset: [ "misc1", "misc2" ] }
   ],
   { multi: true }
)
</code></pre>

<p>My question is: how can I do this using <strong>MongoDB on C#</strong>?</p>

